  [],\n\t\"revision_timestamp\": \"2015-12-20T18:54:18.724500\",\n\t\"name\": \"nauru-island-radiocarbon-data-for-1994-to-1995\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Nauru-2 coral radiocarbon (14C) timeseries.
  (166E, 0.5S, 14m bottom depth). Coral radiocarbon (Delta-14C) on untreated, low-speed
  drilled samples. Precision is +/- 4 per mil as documented by an in-house homogenized
  coral standard, and presented as AGE CORRECTED DELTA-14C [see Stuiver Polach, 1977].
  Cores were taken from a 1.6 meter Porties spp coral on the north side of Nauru Island
  (166E 0.5S), 14m bottom depth, in July of 1995 by D. Schrag M. Moore. Cores were
  split and cleaned with distilled water. After identifying the major vertical growth
  axis, the coral was sequentially sampled at 2 mm increments with a low-speed drill.
  Splits (~1 mg) were reacted in vacuo in a modified autocarbonate device at 90 deg
  C and the purified CO2 analyzed on a gas source stable isotope ratio mass spectrometer.
  The remaining sample splits (~10 mg) were placed in individual reaction chambers,
  evacuated, heated, and then acidified with orthophosphoric acid at 90 deg C. The
  evolved CO2 was purified, trapped, and converted to graphite in the presence of
  cobalt catalyst in individual reactors [Vogel et al., 1987]. Graphite targets were
  measured at the Center for Accelerator Mass Spectrometry, Lawrence Livermore National
  Laboratory [Davis et al., 1990]. Radiocarbon results are reported as Delta-14C (&oacute;)
  as defined by Stuiver and Polach [1977] and include the d13C correction obtained
  from the stable isotope results. Analytical precision and accuracy of the radiocarbon
  measurements is +/- 4&oacute; (1s) based on repeated analyses of an in-house homogenized
  near-modern coral and accepted secondary and tertiary radiocarbon standards. In
  keeping with the definition of \"high-precision radiocarbon\" (less than 3 per mil,
  1-sigma) data have been rounded to zero significant figures. The age model for these
  data was derived from a preliminary delta-13C age model which was then optimized
  by mapping the delta-18O data to a local instrumental precipitation record. Age
  model errors are estimated (brute force approach) at +/- 2-3 months.\",\n\t\"license_title\":
